svg.script:
    function show_floor(floor) {
		var f1 = document.getElementById('F1');
		var f2 = document.getElementById('F2');

		if (floor == 1) {
			var active = f1;
			var inactive = f2;
		} else {
			var active = f2;
			var inactive = f1;
		}

		active.style.display = "inline";
		inactive.style.display = "none";
	}
	function activate_button(floor) {
		var f1button_bevel = document.getElementById('F1Button_bevel');
		var f1button = document.getElementById('F1Button_fill');
		var f1button_emboss = document.getElementById('F1Button_emboss');
		var f2button_bevel = document.getElementById('F2Button_bevel');
		var f2button = document.getElementById('F2Button_fill');
		var f2button_emboss = document.getElementById('F2Button_emboss');
		if (floor == 1) {
			var active_button_bevel = f1button_bevel;
			var active_button = f1button;
			var active_button_emboss = f1button_emboss;
			var inactive_button_bevel = f2button_bevel;
			var inactive_button = f2button;
			var inactive_button_emboss = f2button_emboss;
		} else {
			var active_button_bevel = f2button_bevel;
			var active_button = f2button;
			var active_button_emboss = f2button_emboss;
			var inactive_button_bevel = f1button_bevel;
			var inactive_button = f1button;
			var inactive_button_emboss = f1button_emboss;
		}

		active_button_bevel.style.fill = "url(#active_button_border)";
		active_button.style.stroke = "url(#active_button_stroke)";
		active_button.style.fill = "url(#active_button_fill)";
		active_button_emboss.style.fillOpacity = 0.46276598;
		inactive_button_bevel.style.fill = "url(#inactive_button_border)";
		inactive_button.style.stroke = "url(#inactive_button_stroke)";
		inactive_button.style.fill = "url(#inactive_button_fill)";
		inactive_button_emboss.style.fillOpacity = 0.95744683;

		camera_floor(floor);
	}

	var camera = null;
	var camera_animate = null;
	var lastfloor = 1;
	function camera_floor(floor) {
		if (floor == lastfloor) {
			return;
		}
		lastfloor = floor;

		function _create_camera_animation(right) {
			if (right) {
				var from = "0";
				var to = "73.63766";
			} else {
				var from = "73.63766";
				var to = "0";
			}

			var anim = document.createElementNS("http://www.w3.org/2000/svg", "animateTransform");
			anim.setAttribute('attributeType', "XML");
			anim.setAttribute('attributeName', "transform");
			anim.setAttribute('type', "translate");
			anim.setAttribute('dur', "0.3s");
			anim.setAttribute('fill', "freeze");
			anim.setAttribute('begin', "indefinite");
			anim.setAttribute('from', from+" 0");
			anim.setAttribute('to', to+" 0");
			return anim;
		}
		if (camera == null) {
			camera = document.getElementById('Nav_Camera');
		} else {
			camera.removeChild(camera_animate);
		}
		if (floor == 1) {
			camera_animate = _create_camera_animation(false);
		} else {
			camera_animate = _create_camera_animation(true);
		}
		camera.appendChild(camera_animate);
		camera_animate.beginElement();
	}

	function click_floor(floor) {
		show_floor(floor);
		activate_button(floor);
	}
	function _click_f1(evt) {
		click_floor(1);
		return false;
	}
	function _click_f2(evt) {
		click_floor(2);
		return false;
	}

	var rooms = {
		'windover': 1,
		'portage_auditorium': 1,
		'charlevoix_a': 1,
		'charlevoix_b': 1,
		'charlevoix_c': 1,
		'algonquin_a': 1,
		'algonquin_bc': 1,
		'algonquin_d': 1,
		'tc_linguinis': 1,
		'board_directors': 2,
		'board_governors': 2,
		'montcalm': 2,
		'hamlin': 2,
		'baldwin_boardroom': 2,
		'board_trustees': 2,
		'board_regents': 2,
		'nicolet': 2
	};

	function get_room_list() {
		return Object.keys(rooms);
	}
	function select_room(room) {
		if (rooms.hasOwnProperty(room)) {
			click_floor(rooms[room]);
		}
		animate_room(room);
	}
	function select_random_room() {
		var list = get_room_list();
		var index = Math.floor(Math.random() * list.length);
		var room = list[index];
		select_room(room);
	}

	var animatedParent = null;
	var animated1 = null;
	var animated2 = null;

	function animate_room(room) {
		if (animatedParent) {
			animatedParent.removeChild(animated1);
			animatedParent.removeChild(animated2);
			animatedParent = null;	
			animated1.endElement();
			animated2.endElement();
		}
		if (rooms.hasOwnProperty(room)) {
			animated1 = document.createElementNS("http://www.w3.org/2000/svg", "animate");
			animated1.setAttribute('id', "animate1");
			animated1.setAttribute('attributeType', "CSS");
			animated1.setAttribute('attributeName', "fill");
			animated1.setAttribute('from', "#2993ff");
			animated1.setAttribute('to', "#a7e7b8");
			animated1.setAttribute('begin', "animate2.end");
			animated1.setAttribute('dur', "0.75s");
			animated1.setAttribute('repeatCount', "1");
			animated1.setAttribute('onend', "animated2.beginElement()");
			animated2 = document.createElementNS("http://www.w3.org/2000/svg", "animate");
			animated2.setAttribute('id', "animate2");
			animated2.setAttribute('attributeType', "CSS");
			animated2.setAttribute('attributeName', "fill");
			animated2.setAttribute('from', "#a7e7b8");
			animated2.setAttribute('to', "#2993ff");
			animated2.setAttribute('begin', "indefinite");
			animated2.setAttribute('dur', "0.75s");
			animated2.setAttribute('repeatCount', "1");

			animatedParent = document.getElementById(room);
			animatedParent.appendChild(animated1);
			animatedParent.appendChild(animated2);
			animated2.beginElement();
		}
	}
